data.value:
где:
- Ft - тактовая частота тестового сигнала;
- Ти - длительность импульса етстового сигнала;
- Кn - параметр, значение которого зависит от типа кодирования. При последовательном кодировании Кn = 1, параллельном кодировании Кn = n/2;
- Кс - параметр, значение которого зависит от вида кода. При потенциальном коде Кс = √ 2, при импульсном Кс = 1;
- fj - частота, на которой проводились 
- Е(c+i)j - уровень тестового сигнала с учётом коэффициента калибровки антенны;
- Ешj - уровень поля помех с учётом коэффициента калибровки антенны;
- Еизмj - значение напряжённости электрического поля;
- R2j - величина зоны 2;
- Кстзат - коэффициент стандартного затухания;
